import React from "react";
import "./Components.css";
import me from './me.jpg'
import Partilces from 'react-particles-js'

function Home() {
  return (
    <div className="home">
      <div>
        <img src={me} alt="Me"/>
        <Partilces />
      </div>
    </div>
  );
}

export default Home;
